import React, { Component } from 'react';
import Event from '../../components/Event/Event';
class Events extends Component {
    render() {
        return (
            <div>
                <div className="row">
                    <div className="col-md-6" ><Event event="Tech War" content="Event one"></Event></div>
                    <div className="col-md-6"><Event event="Tech Charades" content="Event Two"></Event></div>
                </div>
                <div className="row">
                    <div className="col-md-6" ><Event event="Tech War" content="Event one"></Event></div>
                    <div className="col-md-6"><Event event="Tech Charades" content="Event Two"></Event></div>
                </div>

              <Event event="Bamboozled" content="another event"></Event>
            </div>
        );
    }
}

export default Events;
